window.bookSummaryJSON = "<p><i>The Rant is Due</i> features Emmy and Grammy Award-winning comedian Lewis Black performing diatribes submitted by his fans. For the first time, these hilarious rants, performed in front of a live audience, are available as a weekly audio program.</p><p> Lewis Black is an Emmy and Grammy Award-winning comedian and political satirist known for his regular appearances on <i>The Daily Show</i>, HBO and Comedy Central. He is also a voice actor for animated films – most recently as “Anger” in Pixar’s Academy Award-winning feature, <i>Inside Out</i>. He has written three best-selling books and more than 40 plays. Over a million followers connect with Lewis on social media every day.</p><p>\"I could not be more thrilled that <i>The Rant is Due</i> has found a home at Audible,” said Lewis Black. “A new audience will hear the rants of their fellow citizens, and my two cents as well. It will not change your life but it will be a lot of fun. And if it’s not a lot of fun, it will piss you off and that’s a really good time in my book.\"</p><p><i>The Rant is Due</i> is a premium, original Audible Comedy series. Listeners can find additional information about the show, latest episodes, and submit their own Lewis Black rants, at Audible.com/lewisblack.</p>"; 
